import React from 'react';
import { Checkbox, FormControl, FormControlLabel, FormGroup, FormLabel } from '@mui/material';

const options = [
  { id: '1', label: 'Литые елки' },
  { id: '2', label: 'Уличные елки' },
  { id: '3', label: 'Елки с лампочками' },
  { id: '4', label: 'Заснежные елки' },
  { id: '5', label: 'Комбинированные елки' },
];

export default function FormControlLabelPosition() {
  return (
    <FormControl component="fieldset">
      <FormLabel component="legend">Елки</FormLabel>
      <FormGroup aria-label="position" column>
        {options.map(({ id, label }) => (
          <FormControlLabel
            key={id}
            value={id}
            control={<Checkbox size="small" style={{ marginLeft: '10px' }} />}
            label={label}
            labelPlacement="left"
          />
        ))}
      </FormGroup>
    </FormControl>
  );
}
